from pyspark.sql.functions import col, size
def getDataFrameFromHive():
    df=spark.sql("SELECT DISTINCT invoice,stockcode FROM marketbasket.Stocks LIMIT 200000");
    return df
def transformDataFrameToAssoicationAnalysis(t):
    tdf=t.rdd.map(lambda row:(row[0],[row[1]])).reduceByKey(lambda x,y:x+y).toDF(["invoiceid","items"])
    return tdf
